E_D("replace into `www_92game_net_enewstags` values('32','澳大利亚','1','0','1','澳大利亚不但环境优美而且景色秀丽，夏不酷暑、冬不寒冷，日照充足，雨量丰沛。接下来澳大利亚频道就与大家分享澳大利亚风景图片,澳大利亚风景名胜等唯美图片，一起看看澳大利亚这座世界上最独特且最多样化的自然环境,独特的野生动植物和壮观的地貌,还有众多国家公园和世界遗产保护区。','','澳大利亚,澳大利亚风景图片,澳大利亚风景名胜');");
E_D("replace into `www_92game_net_enewstags` values('33','法国','4','0','1','巴黎是令人向往的“浪漫之都”的话,那么法国就是享誉世界的“浪漫之国”，法国是个富于艺术情调的国家。法国人民以爱美闻名于世，他们不但利用美丽的自然环境，开辟了许多旅游胜地，而且形成了他们富有特色的法兰西文化。今天27270法国频道就与大家分享美丽的浪漫之国法国,法国城市,法国景点,法国巴黎图片,法国风景图片等。','','法国城市,法国景点,法国巴黎图片,法国风景图片');");
