E_D("replace into `www_92game_net_enewstags` values('35','峡谷','2','0','2','峡谷是深度大于宽度谷坡陡峻的谷地，V型谷的一种。一般发育在构造运动抬升和谷坡由坚硬岩石组成的地段。当地面隆起速度与下切作用协调时，易形成峡谷。中国长江的三峡，黄河干流的刘家峡、青铜峡等，是修建水库坝址的理想地段。下面一起看看峡谷频道带来的众多唯美的峡谷,大峡谷,峡谷深处,峡谷图片等。','','峡谷,大峡谷,峡谷深处,峡谷图片');");
