E_D("replace into `www_92game_net_enewstags` values('38','蓝天白云','2','0','2','蓝色天空白色云彩，是最普通的自然现象，形容好天气。蓝天大多有白云陪衬，变幻莫测的云，或流动，或停驻，有意无意地为蓝天添了装饰平视蓝天则是一望无际的素面，满眼都湛蓝或者蔚蓝的颜色。接下来一起欣赏唯美的蓝天白云,蓝天白云图片,蓝天白云壁纸,蓝天白云背景吧！','','蓝天白云,蓝天白云图片,蓝天白云壁纸,蓝天白云背景');");
E_D("replace into `www_92game_net_enewstags` values('39','雪山','2','0','2','雪山主峰与副峰群分布在雪山山脉的中段，约在台中县与苗栗县的县界上，地处雪霸国家公园境内。以雪山主峰为中心，周围一带地质特色、岩性皆相似的山块，称为雪山地垒。雪山地垒的基岩为始新世晚期或渐新世早期之四棱砂岩，是一种石英变质砂岩，硬度非常高，耐风化侵蚀，因此造就了雪山地垒的高耸地势。下面雪山频道就带大家一起欣赏唯美高清的雪山,雪山图片,玉龙雪山图片,西岭雪山图片,日本雪山图片。','','雪山图片,玉龙雪山图片,西岭雪山图片,日本雪山图片');");
