E_D("replace into `www_92game_net_enewstags` values('48','山脉','0','0','2','山地延伸成脉状称之为山脉，世界上最长最著名的山脉，亚洲的喜马拉雅山系，其中包括有柴斯克山脉、拉达克山脉、西瓦利克山脉和大、小喜马拉雅山脉。而欧洲的阿尔卑斯山脉、北美洲的落基山脉、南美洲的安第斯山脉等。若是想了解更多的山脉那就赶紧到27270山脉频道这里汇集了世界最新最全的山脉摄影图,山脉风景图片。','','中国山脉,山脉摄影图,山脉风景图片');");
E_D("replace into `www_92game_net_enewstags` values('49','公园','3','0','2','公园一般可分为城市公园、森林公园、主题公园、专类园等。现代的公园以其环境幽深和清凉避暑而受到人们的喜爱，也成为情侣们，老人们，孩子们的共同圣地，以至于在公园中发生了无数个故事，成为人们喜怒哀乐的又一聚集地，也因此很多的书籍，电影，连续剧的背景都选在了公园。下面一起看看唯美高清的公园,海洋公园,儿童公园,森林公园,景山公园,世界公园风景图片......等各地公园图片。','','公园图片,儿童公园,森林公园,海洋公园,景山公园');");
