E_D("replace into `www_92game_net_enewstags` values('89','希腊','0','0','1','当你看到希腊纯白色的城市的时候，心仿佛会漏掉一拍，让你窒息的景色。法国的浪漫，意大利的淳朴，瑞士的精致，处处都是让人留恋的景色。意大利法国希腊瑞士旅行，选择一路美景陪伴，心情不好也都难。希腊位于欧洲东南部巴尔干半岛南端，全国由半岛南部的伯罗奔尼撒半岛和爱琴海中的3,000余座岛屿共同构成。下面就跟着小编一起欣赏摄影师提供的唯美好看的希腊,古希腊,古希腊建筑,希腊自然风光,希腊风景图片吧！','/d/file/p/2016/09/11/ps44qym2xkq.jpg','希腊,古希腊,古希腊建筑,希腊自然风光,希腊风景图片');");
E_D("replace into `www_92game_net_enewstags` values('90','西藏','0','0','1','西藏,多少人追寻的地方，这是因为西藏以其雄伟壮观、神奇瑰丽的自然风光闻名。它地域辽阔，地貌壮观、资源丰富。自古以来，这片土地上的人们创造了丰富灿烂的民族文化。下面就跟着27270西藏频道一起欣赏唯美的西藏图片,西藏风光,西藏天空等众多西藏风景图片。','','西藏,西藏图片,西藏风光,西藏天空');");
E_D("replace into `www_92game_net_enewstags` values('91','维多利亚港','0','0','1','维多利亚港位于中华人民共和国香港特别行政区的香港岛和九龙半岛之间的海港。世界第三大海港。由于港阔水深，为天然良港，香港亦因而有“东方之珠”、“世界三大天然良港”及“世界三大夜景”之美誉。接下来小编带您一起欣赏唯美的维多利亚港,维多利亚港夜景,维多利亚港图片。','','维多利亚港,维多利亚港夜景,维多利亚港图片');");
E_D("replace into `www_92game_net_enewstags` values('92','夜空','0','1','2','夜空就如一副棋牌一样，点点的繁星就是棋子儿，镶嵌在天幕下，闪闪地发着光，零零碎碎的，就像是一颗颗被老鼠给咬过的小面包。接下来跟着27270夜空频道一起看看各种美丽的夜空图片,唯美夜空图片,唯美夜空月亮图片,浪漫夜空图片,夜空繁星图片等。','','夜空图片,唯美夜空图片,夜空图片大全');");
E_D("replace into `www_92game_net_enewstags` values('93','土耳其','0','0','1','土耳其，就像一个文明的摇篮，这里到处都在孕育着文明。在土耳其，我们可以尽情领略伊斯兰教的魅力。星罗棋布的运河就像闪亮的星光，照耀着属于土耳其的魅力。接下来跟着27270土耳其频道一起欣赏唯美的土耳其,土耳其风景,唯美土耳其风景,土耳其风景图片吧!','','土耳其,土耳其风景,唯美土耳其风景,土耳其风景图片');");
E_D("replace into `www_92game_net_enewstags` values('94','冰山','0','1','2','冰山是一块大若山川的冰，脱离了冰川或冰架，在海洋里自由漂流。冰冻形成的山冰层长年不化的高山两极地带的冰川,入海口处常结成巨大的冰块,受海浪冲击而断裂,漂浮海上,成为冰山。赶紧跟着小编一起欣赏唯美高清的冰山,冰山图片,冰山背景图片,冰山风景图片,冰山一角图片吧！','/d/file/p/2016/09/11/zl1b52or141.jpg','冰山图片,冰山背景图片,冰山风景图片');");
E_D("replace into `www_92game_net_enewstags` values('95','名胜古迹','0','0','1','世界各国著名名胜古迹实在是数不尽数，其中中国拥有世界上最古老的名胜古迹众多的国家，历史悠久，地域辽阔，风景名胜甲天下。古今名人来到这些名山大川、古迹胜地，往往因触景生情而兴致大发，欣然而命笔。接下来就一起看看博大精深的历史文化，里面汇集了众多关于中国名胜古迹,世界名胜古迹,北京名胜古迹等各式各样地域辽阔的名胜古迹图片。','','中国名胜古迹,世界名胜古迹,名胜古迹图片');");
E_D("replace into `www_92game_net_enewstags` values('96','桂林','0','0','1','桂林山水一向以山青、水秀、洞奇、石美而享有“山水甲天下”的美誉，桂林山水包括山、水、喀斯特岩洞、石刻等桂林山水中以漓江流经阳朔的那一段最为美丽，故而有“桂林山水甲天下，阳朔山水甲桂林”之美誉。下面一起欣赏唯美的桂林,桂林山水,_桂林风景,桂林山水风景,桂林山水图片吧！','','桂林,桂林山水,桂林风景,桂林山水风景图片');");
E_D("replace into `www_92game_net_enewstags` values('97','乌镇','0','0','1','乌镇地处江南水乡,有“鱼米之乡，丝绸之府”之称。同时乌镇也是最具典型江南水乡特征,完整地保存着原有晚清和民国时期水乡古镇的风貌和格局。走进乌镇，更像走进一幅水墨画，无论是驻住停留又或是穿街走巷都是那么的自然，古朴，典雅，漫步在这里很容易让人忘却时间的存在，又仿佛时光倒流，置身于一段古老的岁月中。下面就一起跟着小编欣赏唯美的江南水乡乌镇,乌镇图片,乌镇旅游图片,乌镇景点图片,乌镇风景图片吧！','','乌镇图片,乌镇旅游图片,乌镇景点图片,乌镇风景图片');");
E_D("replace into `www_92game_net_enewstags` values('98','海滨','0','0','2','海滨是很多海洋生物栖息的地方，螃蟹是海滨最常见的东西，它是为数不多的穿过这一潮汐中间地带的生物之一。世界各地的海滨充满了特有的风韵，从轻轻的海风到肆虐的飓风，它们将海滨的岩石雕刻得千姿百态。接下来一起看看唯美的海滨,海滨城市,海滨城市图片吧！','','海滨,海滨城市,海滨城市图片');");
E_D("replace into `www_92game_net_enewstags` values('99','晚霞','0','0','2','早晨和傍晚，在日出和日落前后的天边，时常会出现五彩缤纷的彩霞。朝霞和晚霞的形成都是由于空气对光线的散射作用。当太阳光射入大气层后，遇到大气分子和悬浮在大气中的微粒，就会发生散射。下面一起欣赏众多唯美好看的晚霞图片,晚霞摄影图片,晚霞图片大全以及晚霞夕照等。','','晚霞图片,晚霞摄影图片,晚霞图片大全');");
E_D("replace into `www_92game_net_enewstags` values('100','北京','0','0','1','北京频道汇集的众多高清唯美的北京风景,北京风景图片,北京风景名胜,北京风景优美的地方以及北京风景名胜图片等旅游图片。改革开放以来,北京市风景名胜区事业有了很大发展。1982年,八达岭—十三陵风景名胜区被国务院审定公布为首批国家重点风景名胜区之一。','','北京,北京风景,北京风景图片,北京风景壁纸');");
E_D("replace into `www_92game_net_enewstags` values('101','城堡','0','1','2','城堡是欧洲中世纪的产物，公元1066年至1400年是兴建城堡的鼎盛时期，欧洲贵族为争夺土地、粮食、牲畜、人口而不断爆发战争，密集的战争导致了贵族们修建越来越多、越来越大的城堡，来守卫自己的领地。下面小编选出“最美的城堡,城堡图片,城堡图片大全等。','','城堡图片,拉斐特城堡,温莎城堡,爱丁堡城堡');");
