E_D("replace into `www_92game_net_enewstags` values('107','比萨斜塔','0','0','1','比萨斜塔是意大利比萨城大教堂的独立式钟楼，位于意大利托斯卡纳省比萨城北面的奇迹广场上。它们的外墙面均为乳白色大理石砌成，各自相对独立但又形成统一罗马式建筑风格。接下来一起欣赏美丽的比萨斜塔,比萨斜塔图片,比萨斜塔图片大全等。','','比萨斜塔,比萨斜塔图片,比萨斜塔图片大全');");
E_D("replace into `www_92game_net_enewstags` values('108','高原','0','1','2','高原素有“大地的舞台”之称，面积广大，地形开阔，周边以明显的陡坡为界。世界最高的高原要数中国的青藏高原，面积最大的高原为南极冰雪高原。今天小编就要与大家分享林木繁茂，景色秀丽的高原,青藏高原,帕米尔高原,黄土高原等众多唯美高清的高原风景图片以及美丽高原摄影图。','','高原图片,高原风景图片,美丽高原摄影图');");
E_D("replace into `www_92game_net_enewstags` values('109','峨眉山','0','0','1','峨眉山位于四川省乐山市峨眉山市境内，地势陡峭，风景秀丽，有“秀甲天下”之美誉。峨眉山层峦叠嶂、山势雄伟，景色秀丽，气象万千，素有“一山有四季，十里不同天”之妙喻。接下来就跟着27270峨眉山频道一起欣赏风景秀丽的峨眉山,峨眉山风景,峨眉山风景图片吧！','','峨眉山,峨眉山风景,峨眉山风景图片');");
E_D("replace into `www_92game_net_enewstags` values('110','日本','3','0','1','想寻找传统日本的旅行者，不可错过京都、奈良、镰仓等古都的庙宇、神社与街道。对大都市风貌感兴趣的朋友，东京、大阪、名古屋的摩天大厦和游乐园可以满足你的需求。横滨、神户、长崎、函馆等港口城市，有着浓郁的西欧风情。下面跟小编一起看看唯美的日本风景,日本自然风光,日本旅游景点,日本风景图片等。','','日本风景,日本自然风光,日本旅游景点,日本风景图片');");
E_D("replace into `www_92game_net_enewstags` values('111','富士山','0','0','1','富士山被日本人民誉为“圣岳”，是日本民族的象征。作为日本的国家象征之一，在全球享有盛誉。它也经常被称作“芙蓉峰”或“富岳”以及“不二的高岭”。自古以来，这座山的名字就经常在日本的传统诗歌“和歌”中出现。今天27270富士山频道就与大家分享高清唯美的富士山,富士山图片,富士山风景图片,富士山摄影图等。','','富士山,富士山图片,富士山风景图片,富士山摄影图');");
E_D("replace into `www_92game_net_enewstags` values('112','雪花','0','1','2','雪花，一种晶体，结构随温度的变化而变化，又名未央花和六出，一种美丽的结晶体，它在飘落过程中成团攀联在一起，就形成雪片。下面跟着小编一起欣赏雪白雪白的雪花,雪花图片,唯美雪花图片,雪花图片大全吧！','','雪花,雪花图片,,唯美雪花图片,雪花图片大全');");
