E_D("replace into `www_92game_net_enewstags` values('255','冰淇淋','0','1','10','冰淇淋源于中国，是一种极具诱惑力的美味冷冻奶制品。冰淇淋是一种含有优质蛋白质及高糖高脂的食品，另外还含有氨基酸及钙、磷、钾、钠、氯、硫、铁等，具有调节生理机能、保持渗透压和酸碱度的功能。接下来小编就与大家分享唯美的冰淇淋,冰淇淋图片,甜筒冰淇淋图片,美味冰淇淋图片吧！','','冰淇淋图片,甜筒冰淇淋图片,美味冰淇淋图片');");
