E_D("replace into `www_92game_net_enewstags` values('261','孔雀','1','0','6','孔雀又名为越鸟，东南亚东印度群岛和南亚印度产的一种大型的陆栖雉类，有羽冠，雄的尾毛很长，展开时像扇子。其主要特征是体型像雁那么大，有三四尺高，颈部细，背部隆起，头部有三根毛，约一寸长，常常几十只聚在一起飞翔，早晨鸣叫声此起彼伏。今天小编就与大家分享各种骄傲的孔雀,蓝孔雀,白孔雀,绿孔雀,黑孔雀,金孔雀等众多品种的孔雀图片。','','孔雀,蓝孔雀,白孔雀,绿孔雀,黑孔雀,金孔雀');");
E_D("replace into `www_92game_net_enewstags` values('262','狐狸','1','0','6','狐狸拥有灵活的耳朵能对声音进行准确定位、嗅觉灵敏，修长的腿能够快速奔跑，性格机敏胆小，常在古代神话中以“狐狸精”出现，虽在远古也曾作为图腾，但从不出现于正式祭祀中，皆因其“形象不雅”，多与狡诈鬼祟相关联。接下来狐狸频道为广大网友提供最高清的小狐狸,白狐狸,红狐狸,狐狸图片,卡通狐狸图片,白狐狸图片,狐狸图片大全等。','/d/file/p/2016/09/11/fyqqtj4f2tj.jpg','狐狸图片,卡通狐狸图片,狐狸图片大全');");
E_D("replace into `www_92game_net_enewstags` values('263','昆虫','13','0','6','昆虫种类繁多、形态各异，是地球上数量最多的动物群体，它们的踪迹几乎遍布世界的每一个角落。昆虫在生物圈中扮演着很重要的角色。虫媒花需要得到昆虫的帮助，才能传播花粉。而蜜蜂采集的蜂蜜，也是人们喜欢的食品之一。在非洲、东南亚和南美的一些地方，昆虫本身就是当地人的食品。下面小编精挑细选出众多唯美的昆虫,昆虫图片,昆虫图片大全等。','','昆虫,昆虫图片,昆虫图片大全');");
E_D("replace into `www_92game_net_enewstags` values('264','鸟类','14','0','6','鸟类是自古代爬行类中的恐龙类进化而来，一方面继承了爬行类的某些结构，一方面又出现适应飞翔和恒温的新结构。心脏有两个心房和两个心室，动脉血与静脉血完全分开，保证了动脉血中含有丰富的氧。接下来小编与大家分享各种鸟类,鸟类大全,鸟类图片,鸟类图片大全吧！','','鸟类,鸟类大全,鸟类图片,鸟类图片大全');");
