E_D("replace into `www_92game_net_enewstags` values('266','熊猫','0','0','6','众所周知，熊猫是我国的国宝，它有着圆圆的脸颊，大大的黑眼圈，胖嘟嘟的身体，十分的惹人喜爱。今天小编在炎热的夏天给大家分享可爱呆萌的熊猫,大熊猫,可爱熊猫,熊猫图片,大熊猫图片,卡通大熊猫图片等，喜欢大家能喜欢。','','熊猫,大熊猫,可爱熊猫,熊猫图片');");
E_D("replace into `www_92game_net_enewstags` values('267','松鼠','0','0','13','松鼠的分布范围较广，在整个寒温带森林地区都能见到，其主要特征是长着又大又蓬松的尾巴,黑眼珠亮晶晶,老是鼓着腮帮子,用前爪抱着点吃的啃,这种可爱的小动物就是松鼠。根据生活环境不同，松鼠科分为树松鼠、地松鼠和石松鼠等。下面就跟着27270松鼠频道一起欣赏唯美可爱的松鼠,小松鼠,雪地松鼠,金花松鼠等松鼠高清图片吧！','','松鼠,小松鼠,雪地松鼠,金花松鼠');");
E_D("replace into `www_92game_net_enewstags` values('268','蜘蛛','2','0','6','蜘蛛对人类有益又有害，但就其贡献而言，主要是益虫。例如，在农田中蜘蛛捕食的，大多是农作物的害虫。同时许多中医药中，都有用蜘蛛入药的记载，因此，保护和利用蜘蛛具有重要的意义。接下来跟着小编一起看看唯美的蜘蛛,蜘蛛图片,蜘蛛图片大全吧！','','蜘蛛,蜘蛛图片,蜘蛛图片大全');");
E_D("replace into `www_92game_net_enewstags` values('269','小鸭子','0','0','6','小鸭子披了一身黄黄的毛茸茸的毛,有一张扁扁的小嘴,枫叶般的脚蹼,走起路来左摇右摆.如果遇到一个水塘,它马上会扑过去,跳入水塘,双腿一蹬,钻入水塘,不见了。下面跟着小编一起欣赏可爱呆萌的小鸭子,小鸭子图片,小鸭子图片大全吧！','','小鸭子,小鸭子图片,小鸭子图片大全');");
E_D("replace into `www_92game_net_enewstags` values('270','七星瓢虫','0','1','6','很少有人知道，七星瓢虫还是个会游泳和潜水的能手。把一只七星瓢虫投放于洗脸盘中，这只瓢虫不仅能在水面上游泳，还能潜入水中自由行走。这个实验反复进行了多次，共计20分钟。最后七星瓢虫爬上洗脸盘边沿，在阳光下打开鞘翅晒干后飞走。下面一起看看唯美高清的瓢虫,瓢虫图片,七星瓢虫图片,七星瓢虫图片大全吧！','','七星瓢虫,七星瓢虫图片,七星瓢虫图片大全');");
E_D("replace into `www_92game_net_enewstags` values('271','画眉鸟','1','0','12','画眉鸟是雀形目画眉科的鸟类。大约23厘米。全身大部棕褐色。头顶至上背具黑褐色的纵纹，眼圈白色并向后延伸成狭窄的眉纹。一起欣赏画眉鸟,画眉鸟图片,极品画眉鸟图片,画眉鸟的图片。','/d/file/p/2016/09/11/2oto1j3vtfh.jpg','画眉鸟,画眉鸟图片,极品画眉鸟图片');");
