E_D("replace into `www_92game_net_enewstags` values('582','狼','1','0','5','狼外形和狼狗相似，但吻略尖长，口稍宽阔，耳竖立不曲。尾挺直状下垂；毛色棕灰。栖息范围广，适应性强，凡山地、林区、草原、荒漠、半沙漠以至冻原均有狼群生存。今天27270狼频道就与大家分享牙尖嘴利的狼,狼图片,狼图片大全等，一起进来看看吧！','','狼,狼图片,狼图片大全');");
