E_D("replace into `www_92game_net_enewstags` values('584','比格犬','0','0','5','比格犬，是世界名犬犬种之一，在分类上属于狩猎犬。比格犬的吠声比其他猎犬高亢，故有“森林之铃”之称，是漫画史努比的原型犬只。比格犬,比格犬图片,比格犬图集,比格犬图片大全,比格犬照片等内容为大家献上。','','比格犬,比格犬图片,比格犬图集');");
E_D("replace into `www_92game_net_enewstags` values('585','猫','1','0','6','猫乖巧可爱众所周知，猫不但十分的爱干净,而且跟主人也十分的亲昵，所以猫咪很多时候都做出很多搞笑的动作，从而网络就会流传出各种猫咪图片。接下来就跟小编一起欣赏猫,暹罗猫,波斯猫,折耳猫,茶杯猫,猫咪等精美可爱的猫图片等。','/d/file/p/2016/09/11/5345eyhmxrv.jpg','猫,暹罗猫,波斯猫,折耳猫,茶杯猫');");
