E_D("replace into `www_92game_net_enewstags` values('587','柴犬','0','0','5','柴犬最初是用来狩猎大型猎物，但是现在他们用于狩猎较小的动物。在日本的城市、郊区和乡村都可看到柴犬。柴犬能够应付陡峭的丘陵和山脉的斜坡，拥有灵敏的感官，使得柴犬屡次成为上乘的猎狩犬。下面一起跟小编欣赏机智聪明的柴犬,日本柴犬,小柴犬,豆柴犬吧！','','柴犬,日本柴犬,小柴犬,豆柴犬');");
E_D("replace into `www_92game_net_enewstags` values('588','小兔子','0','0','6','小兔子浑身长毛茸茸的，像一团棉花。它的一双红眼睛嵌在眼窝里，像镶着两颗红宝石，两只长长的耳朵，足有二寸半，兔子性情温和，整天蹦蹦跳跳。今天小编就为大家分享可爱的小兔子,可爱小兔子,小兔子图片,小兔子图片大全等。','/d/file/p/2016/09/11/gsh5jtsxzgd.jpg','小兔子,可爱小兔子,小兔子图片');");
E_D("replace into `www_92game_net_enewstags` values('589','牧羊犬','0','0','5','牧羊犬是充满灵性的犬中明星:有些犬以娇小漂亮的外形获得人们的喜爱,有些犬以善解人意的灵气得到主人的信任。下面跟小编一起看看可爱的牧羊犬,边境牧羊犬,德国牧羊犬,苏格兰牧羊犬,比利时牧羊犬,中亚牧羊犬,喜乐蒂牧羊犬等各种品种的牧羊犬图片！','','边境牧羊犬,德国牧羊犬,苏格兰牧羊犬,比利时牧羊犬');");
E_D("replace into `www_92game_net_enewstags` values('590','梗犬','0','0','5','&amp;15988犬是一类最初是被用来打猎和消除毒蛇、害虫、田鼠的犬类。它们精力充沛、个性活跃；是一种对主人忠诚、亲善的犬种。今天小编就与大家分享可爱调皮的梗犬,牛头梗犬,波士顿梗犬,梗犬图片吧！','','梗犬,牛头梗犬,波士顿梗犬,梗犬图片');");
E_D("replace into `www_92game_net_enewstags` values('591','仓鼠','1','0','13','仓鼠最常见的毛色以由脸颊到腹部为白色，背部为褐色的居多，但也有由深浅褐色形成的斑点，毛色多为灰色，而后培育出了金色、花斑色等，甚至是长毛的多样化品种。接下来跟小编一起看看可爱呆萌的仓鼠,银狐仓鼠,布丁仓鼠,三线仓鼠,奶茶仓鼠,雪球仓鼠吧！','','仓鼠,银狐仓鼠,布丁仓鼠,三线仓鼠,奶茶仓鼠');");
E_D("replace into `www_92game_net_enewstags` values('592','丹顶鹤','1','0','6','丹顶鹤是鹤类的代表，是一种大型涉禽，这种鸟从头到脚，每个部分都显得匀称、修长：暗褐色的小眼睛，暗绿色的长嘴巴，长长的脖子，还有两条铅黑色的长腿。下面跟着小编一起看看唯美高清丹顶鹤,丹顶鹤图片,丹顶鹤图片大全吧！','','丹顶鹤,丹顶鹤图片,丹顶鹤图片大全');");
E_D("replace into `www_92game_net_enewstags` values('593','白天鹅','0','0','6','天鹅是一种候鸟，主要生活在多芦苇的湖泊、水库和池塘中。其主要的特征身体丰满，双脚短粗，趾间有蹼。脖子很长，几乎与身体一样长。全身披白色羽毛，在水中游动时伸着脖子与身体稍呈直角，一副悠闲自得的神态。下面跟小编一起看看精心的白天鹅,美丽白天鹅,白天鹅图片吧！','','白天鹅,美丽白天鹅,白天鹅图片');");
E_D("replace into `www_92game_net_enewstags` values('594','鹦鹉','0','0','6','鹦鹉拥有美丽的羽毛，善学人语技能的特点，典型的攀禽，对趾型足，两趾向前两趾向后，适合抓握，鸟喙强劲有力，可以食用硬壳果。深受人们所喜爱。接下来就一起欣赏唯美可爱的鹦鹉,虎皮鹦鹉,金刚鹦鹉,玄凤鹦鹉,牡丹鹦鹉,葵花鹦鹉等品种繁多的鹦鹉图片！','','鹦鹉,虎皮鹦鹉,金刚鹦鹉,玄凤鹦鹉,牡丹鹦鹉');");
E_D("replace into `www_92game_net_enewstags` values('595','小丑鱼','0','0','14','小丑鱼是珊瑚礁中可爱的小精灵，它们有如此的美丽的色彩，且性情温和，健壮活泼易饲养，几乎所有饲养海水观赏鱼的人都会优先选择它作为入门的品种，还有它那与海葵共生的奇特习性，更会令所有的观赏者啧啧称赞.下面一起看看美丽的小丑鱼,小丑鱼图,小丑鱼图片大全吧！','/d/file/p/2016/09/11/2c1zwzufxbh.jpg','小丑鱼,小丑鱼图片,小丑鱼图片大全');");
E_D("replace into `www_92game_net_enewstags` values('596','孟加拉虎','0','0','6','孟加拉虎分布在印度，不丹，巴基斯坦，中国和孟加拉国，是这两个国家的代表动物，是世界濒危野生动物之一。孟加拉虎毛稀短，杏黄色，黑色条纹较窄；老体颊部生有鬃毛,腹部呈白色，头部条纹则较密，耳背为黑色，有白斑，雄性孟加拉虎平均全体长262cm（含尾），除孙德尔本斯外平均体重188公斤。特此27270孟加拉虎频道为广大爱虎的朋友们准备了众多孟加拉虎,孟加拉虎图片,孟加拉虎图片大全等，供大家欣赏。','','孟加拉虎,孟加拉虎图片,孟加拉虎图片大全');");
E_D("replace into `www_92game_net_enewstags` values('597','海豚','1','0','6','在深邃的海底世界,生活着各种各样的奇特生物,不过有一种却显得十分特别,它就是海豚。海豚有一个发达的大脑，科学家们正在研究海豚究竟具备怎样的能力，结果他们发现，海豚不仅仅是有智慧的生物，它们的情商也很高。下面就跟着小编一起看看唯美的海豚,小海豚,白海豚,海豚图片,卡通海豚图片吧！','','海豚,小海豚,白海豚,海豚图片,卡通海豚图片');");
