E_D("replace into `www_92game_net_enewstags` values('599','翠鸟','0','0','6','翠鸟属中型水鸟自额至枕蓝黑色，密杂以翠蓝横斑，背部辉翠蓝色，腹部栗棕色；头顶有浅色横斑；嘴和脚均为赤红色。从远处看很象啄木鸟。因背和面部的羽毛翠蓝发亮，因而通称翠鸟。食物以鱼类为主，兼吃甲壳类和多种水生昆虫。下面就一起跟着小编一起欣赏唯美的翠鸟,翠鸟图片,翠鸟图片大全吧！','','翠鸟,翠鸟图片,翠鸟图片大全');");
E_D("replace into `www_92game_net_enewstags` values('600','变色龙','2','0','6','变色龙是爬行动物，是非常奇特的动物，其主要特征是身体长筒状，两侧扁平，头呈三角形，尾常卷曲。眼凸出，两眼可独立地转动。避役栖息在热带丛林之中，行动非常缓慢，除了繁殖期外都是单独生活。接下来跟着27270变色龙频道一起看看唯美的变色龙,变色龙图片,变色龙图片大全吧！','','变色龙,变色龙图片,变色龙图片大全');");
