E_D("replace into `www_92game_net_enewstags` values('603','信鸽','0','0','6','信鸽其实就是经过普通鸽子的驯化，提取其优越性能的一面加以利用和培育，人们利用信鸽是因为鸽子有天生的归巢的本能，人们培育，发展，利用它来传递紧要信息。今天27272信鸽频道就与大家分享唯美的信鸽,信鸽图片,信鸽图片大全吧！','','信鸽,信鸽图片,信鸽图片大全');");
E_D("replace into `www_92game_net_enewstags` values('604','鲨鱼','0','0','14','鲨鱼，生活在海洋中，是海洋中最凶猛的鱼类。鲨鱼早在恐龙出现前三亿年前就已经存在地球上，至今已超过五亿年，它们在近一亿年来几乎没有改变。在古代叫作鲛、鲛鲨、沙鱼,是海洋中的庞然大物,所以号称“海中狼”。下面就看看唯美好看的鲨鱼,大鲨鱼,虎鲨鱼,鲨鱼图片等鲨鱼图片大全等。','','鲨鱼,大鲨鱼,虎鲨鱼,鲨鱼图片');");
E_D("replace into `www_92game_net_enewstags` values('605','小鸡','0','0','6','小鸡绒乎乎的，羽毛短短的，密密的，一个个像小棉花团似的。圆圆的身子，毛绒绒的，金灿灿的；尖尖的小嘴红红的，灵巧的脚丫黄黄的。它们个个活蹦乱跳，灵气十足，叽叽喳喳，四处觅食。下面一起欣赏唯美的小鸡,小鸡图片,可爱小鸡图片,小鸡图片大全吧！','','小鸡图片,可爱小鸡图片,小鸡图片大全');");
E_D("replace into `www_92game_net_enewstags` values('606','博美犬','0','0','5','博美犬是一种紧凑、短背、活跃的玩赏犬，是德国狐狸犬的一种，它拥有柔软、浓密的底毛和粗硬的皮毛。尾根位置很高，长有浓密饰毛的尾巴卷放在背上。它具有警惕的性格、聪明的表情、轻快的举止和好奇的天性。下面就一起欣赏超萌超可爱的博美犬图片,白博美犬图片,哈多利系博美犬图片等。','/d/file/p/2016/09/11/ruuj5m4horl.jpg','博美犬,博美犬图片,白博美犬图片,哈多利系博美犬图片');");
E_D("replace into `www_92game_net_enewstags` values('607','考拉','0','1','6','考拉是澳大利亚的国宝，也是澳大利亚奇特的珍贵原始树栖动物。它每天18个小时处于睡眠状态，性情温顺，体态憨厚。下面就跟小编一起欣赏可爱呆萌的考拉,考拉图片,小考拉,考拉熊等考拉图片大全吧，看了准保你爱不释手。','','考拉,小考拉,考拉熊,可爱的考拉');");
